USE `iemu_gs`;

DROP TABLE IF EXISTS `character_stats`;
CREATE TABLE `character_stats` (
  `char_id` int(8) NOT NULL,
  `max_hp` double NOT NULL DEFAULT '0',
  `hp` double NOT NULL DEFAULT '0',
  `max_mp` double NOT NULL DEFAULT '0',
  `mp` double NOT NULL DEFAULT '0',
  `phys_crit` double NOT NULL DEFAULT '0',
  `magic_crit` double NOT NULL DEFAULT '0',
  `phys_def` double NOT NULL DEFAULT '0',
  `magic_def` double NOT NULL DEFAULT '0',
  `evasion` double NOT NULL DEFAULT '0',
  `power` double NOT NULL DEFAULT '0',
  `agility` double NOT NULL DEFAULT '0',
  `fitness` double NOT NULL DEFAULT '0',
  `intelligence` double NOT NULL DEFAULT '0',
  `mentality` double NOT NULL DEFAULT '0',
  `accuracy` double NOT NULL DEFAULT '0',
  PRIMARY KEY (`char_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

insert  into `character_stats`(`char_id`,`max_hp`,`hp`,`max_mp`,`mp`,`phys_crit`,`magic_crit`,`phys_def`,`magic_def`,`evasion`,`power`,`agility`,`fitness`,`intelligence`,`mentality`,`accuracy`) values (2585287,3856,3856,3840,3840,0,0,103.019997,82.019997,0,8,6,8,7,8,99.120003);

DROP TABLE IF EXISTS `character_style`;
CREATE TABLE `character_style` (
  `character_id` int(8) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `characters`;
CREATE TABLE `characters` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `account_id` int(8) NOT NULL,
  `charname` varchar(16) NOT NULL,
  `class` int(1) NOT NULL,
  `level` int(3) NOT NULL DEFAULT '1',
  `sex` int(1) NOT NULL,
  `access` enum('PLAYER','GAMEMASTER','ADMINISTRATOR') DEFAULT 'PLAYER',
  `pos_x` double DEFAULT NULL,
  `pos_y` double DEFAULT NULL,
  `pos_z` double DEFAULT NULL,
  `rotate` double DEFAULT NULL,
  `create_time` int(8) NOT NULL,
  `end_gametime` int(8) NOT NULL COMMENT 'последний заход в игру',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2585291 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `inventory`;
CREATE TABLE `inventory` (
  `PlayerItemUID` int(8) NOT NULL AUTO_INCREMENT,
  `char_id` int(8) NOT NULL,
  `item_id` int(8) NOT NULL,
  `count` int(4) NOT NULL,
  `slot` int(4) NOT NULL,
  `equip` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`PlayerItemUID`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

